import React from 'react'
import { Label ,Image, Icon} from "semantic-ui-react"
const Profile = (props) => {
    return (
        <div style={{ position:"fixed", right: "2vw",fontSize:"x-large",top:"3vh" }}>
                <Icon circular inverted color="teal" size="small" name="user"></Icon>
                <span> {props.Name}</span>
        </div>

    )
}

export default Profile
